import { StyleSheet, Text,View} from 'react-native';
export default function StartScreen() {
  return (
    <View style={styles.container}>
        <Text>Стартовая  страница</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  title:{
    paddingBottom: 100
  }
});
